import React from "react";
import { Row, Col, Typography } from "antd";
import {
  FacebookOutlined,
  LinkedinOutlined,
  InstagramOutlined
} from "@ant-design/icons";
import ContactForm from "./ContactForm";
import emailjs from "emailjs-com";
const { Title } = Typography;

const iconStyle = {
  fontSize: "2em",
  color: "black"
};

const TitleStyles = {
  color: "white",
  fontFamily: `"Lato", Arial, Tahoma, sans-serif`,
  fontWeight: 100
};

const SocialMediaIcon = ({ icon, link }) => {
  return (
    <Col span={3} offset={1}>
      <a href={link} target="_blank">
        {icon}
      </a>
    </Col>
  );
};

const Contact = () => {
  return (
    <Row
      style={{ background: "#6f8c84", padding: "20px" }}
      justify="center"
      id="contact"
    >
      <Col span={8} push={2}>
        <Row>
          <Col span={24}>
            <Title level={3} style={TitleStyles}>
              Let's talk! Look me up on
            </Title>
          </Col>
          <SocialMediaIcon
            icon={<LinkedinOutlined style={iconStyle} />}
            link="https://www.linkedin.com/in/ramya-0412"
          />
          <SocialMediaIcon
            icon={<FacebookOutlined style={iconStyle} />}
            link="https://www.facebook.com/ramya.rao.90"
          />
          <SocialMediaIcon
            icon={<InstagramOutlined style={iconStyle} />}
            link="https://www.instagram.com/ramyaarao_"
          />
        </Row>
      </Col>
      <Col span={16} push={4}>
        <ContactForm />
      </Col>
    </Row>
  );
};

export default Contact;
